import React from 'react';
import { withRouter, Link } from 'react-router-dom';
import '../styles/css/header.css'

const Header = (props) => {
    return (
      <React.Fragment>
        <div className="container-fluid">
          <div className="row border header align-items-center">
            <div className="col-md-3 col-2 header__home-btn ml-1">
              <i className="material-icons" to='/'>home</i>
            </div>
            <div className="col-md-5 col-8">
              <input className="form-control" name="search" type="text" onChange={props.doSearch}/>
            </div>
            <div className="col-md-2 col-1">
            </div>
          </div>
        </div>
      </React.Fragment>
    )
}

export default (withRouter(Header));
